// import link from 'next/link';

const headerStyle = {
  margin: 100
};

const bodyStyle = {
  margin: 100
};

function myProjects() {
  return [
    { id: 'famtravel', title: 'Famtravel', link: 'http://www.famtravel.eu' },
    { id: 'superpower-rental', title: 'Superpower Rental',link: 'http://superpower-to-rent.herokuapp.com/' },
    { id: 'my-protein-shake', title: 'My Protein Shake', link: 'https://ohshakemyshake.herokuapp.com/' },
    { id: 'find-out-more', title: 'Find out more on github', link: 'https://github.com/xxinyiwho' },
  ];
};

const ProjectLink = ({ project }) => (
    <a href={project.link}>{project.title}</a>
);

export default function Project() {
  return (
    <>
      <h2 className='my-projects' style={bodyStyle}>More about me</h2>
      <ul>
        {myProjects().map(project => (
          <li key={project.id} style={bodyStyle}>
            <a href={project.link}>{project.title}</a>
          </li>
        ))}
      </ul>

      <div className="description">
        <li><h3>Conception</h3><p>Understanding the clients' needs and help to sketch the project</p></li>
        <li><h3>Design</h3><p>Customerized design proposition, product prototype</p></li>
        <li><h3>Development</h3><p>Website/web application developement and deployment</p></li>
      </div>

    </>
  );
}
